con:configuration.scriptText:
//check response time
assert messageExchange.timeTaken < 600

//check for Endpoint
 log.info ("end point = "+messageExchange.getEndpoint()) 

//check for TimeTaken
 log.info ("time taken for response = "+messageExchange.getTimeTaken())  

//check for header
log.info ("content length = "+messageExchange.responseHeaders["Content-Length"])
assert messageExchange.responseHeaders["Content-Length"] != null

//check attachments
assert messageExchange.responseAttachments.length == 0
log.info ("attachemnets = "+messageExchange.responseAttachments.length)

//validate response nodes
def groovyUtils = new com.eviware.soapui.support.GroovyUtils( context )
def requestHolder = groovyUtils.getXmlHolder( messageExchange.requestContent )
def responseHolder = groovyUtils.getXmlHolder( messageExchange.responseContent )
def refNum = responseHolder.getNodeValue("//m:CountryISOCodeResult")
log.info("response value = "+refNum)
assert responseHolder.getNodeValue("//m:CountryISOCodeResult") == "IN"

//to get response
def resp = messageExchange.responseContentAsXml.toString()
log.info("whole response = "+resp)

